    render() {
        return (
            <div>
                {/* <Navbar> */}
                {/* <Navbar.Header> */}
                {/* <Navbar.Brand> */}
                {/* <a href="javascript:void(0)">MERN Stack CRUD Operations</a> */}
                {/* </Navbar.Brand> */}
                {/* </Navbar.Header> */}
                <Nav>
                    <NavItem href="javascript:void(0)">
                        <Link to="/">Home</Link>
                    </NavItem>
                    <NavItem href="javascript:void(0)">
                        <Link to="/addemployee">Add New Employee</Link>
                    </NavItem>
                </Nav>
                {/* </Navbar> */}
                <h1>Hiiii</h1>
            </div>
        );
    }
}
export default Header;
